(456, 0, 'I was picked up very late for my appointment  on the 28/05/21. l nearly missed my appointment. It was a very important appointment. My return journey was the worst l waited about 3hrs, called and l was told the driver is on his was on his way but nobody showed up. All the staffs at the Willow Annex had to leave because it was their closing time. I was so stressed and anxious .I missed my Carer, missed my dinner delivery, missed my important medications as l never thought l would be that late. I was so much in excruciating pain. It was the worst experience of my life.', '100', 290, 22, NULL, 17, 1, 0, '445', '109.145.253.191', 1, '2021-05-29 01:20:54'),
