(458, 0, 'Dear HATS, I have noticed on numerous occasions your vehicles (usually patient transport ambulances) are left for long periods with their engine idling when parked outside the Grosvenor Wing side entrance at St Georges Hospital Tooting. SW17 0QT. Sometimes the band has no one in it, including no driver. Other times the driver is sitting in the van, also breathing in the exhaust fumes. This is unhealthy and will lead to lung damage of the driver, office staff, patients and of course is also harmful to our planet.  When the automatic doors open gusts of fumes then enter the office and hatch area, and continue into the main foyer. Could you please ask your staff to switch off their engines until the vehicle is needing to move? Thank you', '100', 275, 21, NULL, 9, 1, 0, '457', '213.205.200.66', 1, '2021-05-30 14:45:52'),
