(508, 0, 'No problem with Hats.It was booking the transport that was problem . I made special point of saying is my transport booked for my outpatient appointment . To confirm it had to be a 2 man crew due to 3 steps st my home .I asked this when I left the ward a week ago .Yestrrdsy I rand patient transport yo check it eas booked they said no . I should call my ward Lord Witram and get them to rebook .After waiting 20 minutes to be answered I got a nurse who said she would make sure it was booked. And I stressed a 2 man crew.At 4 pm I checked again with transport still nothing booked .I spoke again to ward no one answered for 25 mins. Got a nurse who said she would book again . This morning on day of appointment ambulance arrived only 1 crew member . So could not help . Then patient transport called yo say they could not do it and book for tomorrow . I said zi had appt with fracture clinic and consultant .then my door went and 3 ambulance crew turned up . Very nice and good . But I spent 5 hours I on phone yesterday to organise this . Bad service from whoever should have booked it in first place . I am dreading my next appt next week and the next few coming . I am unwell registered disabled and this is too stressful and not good ,', '100', 290, 22, NULL, 34, 1, 0, '497', '213.205.240.239', 1, '2021-07-14 16:02:19'),
