(1426, 0, 'I had to be at my appointment for 9.15, the driver didnt arrive to pick me up until 9am.  I did not get to the hospital until gone 11am.  The driver said he didnt beginning his shift until 8am, whereas there are others who start earlier, surely one of these people would have been better to have driven me? I dont mind how long I have to wait after appointments as Im extremely grateful for the transport but this is the second time Ive been late for  appointments.  All the staff are incredibly kind, polite and helpful.', '100', 290, 22, NULL, 34, 1, 0, '1415', '82.132.226.157', 1, '2022-02-01 19:04:27'),
